import { axiosWithAuth } from '../../helpers/index';
import axios from 'axios';


export const FETCH_POST_START = 'FETCH_POST_START';
export const FETCH_POST_SUCCESS = 'FETCH_POST_SUCCESS';
export const FETCH_POST_FAILURE = 'FETCH_POST_FAILURE';


export const fetchPosts = (id) => dispatch => {
  dispatch({ type: FETCH_FIX_START });
 axios
    .get(`${process.env.REACT_APP_API_URL}/car_fix/${id}`) 
    .then(res => {
      console.log(res.data, "data")
      dispatch({ type: FETCH_FIX_SUCCESS, payload: res.data });
    })
    .catch(err => {
        dispatch({ type: FETCH_FIX_FAILURE, payload: err.response });
    });
};

async function fetchCarFixes() {
    const res = await axiosWithAuth().get(`/car_fix/${props.car.id}`); 
    setCarFixes(res.data);
}
